mongoose eventual consistency when populating virtual fields<p>I have a schema with a <em>virtual</em> reference to a different model:</p>

<pre><code>User.virtual('stuffs', {
  ref: 'Stuff',
  localField: '_id',
  foreignField: 'owner',
  options: {},
});
</code></pre>

<p>When a new user registers, I also generate some related <em>stuff</em> for it, and I want to return the user-object with the <code>stuffs</code> field populated, so I do something like:</p>

<pre><code>const user = await (new User(...).save());
const stuff = await (new Stuff({ owner: user._id }).save());
res.json({ user: (await user.populate('stuffs').execPopulate()).toObject({ virtuals: true }) });
</code></pre>

<p>I assume that the <code>populate</code> function operates by querying the <em>stuff</em> collection for a document where the owner is <code>user._id</code>, just like the one that was saved in the command above.</p>

<p>I've read that Mongodb is only eventually-consistent, does that mean that the query might fail and not find the <em>stuff</em> that was just saved? If so, what are the chances? Do I really need to verify that the population succeeded? Should I add a retry-loop with several attempts?</p>

<p>Thanks.</p>

